import React from 'react';
import '../styles/ProductsPage.css';
import backgroundImage from '../assets/deepmind.jpg'; // Importing the image directly

const Company = () => {
  return (
    <div className="products-page">
      {/* Hero Section */}
      <div
        className="companyhero-section"
        style={{
          backgroundImage: `url(${backgroundImage})`, // Use the imported image here
        }}
      >
        <div className="companyhero-overlay">
          <h1>Working towards a Completely Autonomous Future.</h1>
        </div>
      </div>
        </div>
  );
};

export default Company;
